import React from "react";

const SectionCard = ({ data }) => {
  return (
    <div className="px-4 gap-1">
      <h1 className="text-2xl font-medium mb-3">{data?.Title}</h1>
      <p>{data?.description}</p>
    </div>
  );
};

export default SectionCard;
